// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
contract GMalatoToken is ERC721URIStorage, Ownable,AccessControl {
   using Counters for Counters.Counter;
   Counters.Counter private _tokenIds;
   bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE"); 
   constructor() ERC721("GMalatoNFT", "GM") {
       
   }
    mapping (address => uint) Tokens;

    function addMinter(address minter) public onlyOwner{
        _setupRole(MINTER_ROLE, minter);
    }
    
    function getToken(address owner) view public returns(uint){
        return Tokens[owner] ;
    }
   function mintNFT(address recipient, string memory tokenURI) 
       public
       returns (uint256)
   {
        require(isMintedr(), "Voce nao tem privilegios para executar essa acao");
       _tokenIds.increment();
       uint256 newItemId = _tokenIds.current();
       _mint(recipient, newItemId);
       _setTokenURI(newItemId, tokenURI);
        Tokens[recipient] = newItemId;
       return newItemId;
   }
   function isMintedr()  view public returns(bool ) {
       return hasRole(MINTER_ROLE, msg.sender);
    }
   function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721, AccessControl) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}
